import React, {Component} from 'react';
import {Route, Switch} from 'react-router-dom';
import classes from './App.module.css';


class App extends Component {

  render(){
    return (
      <div className={classes.App}>
        <Switch>
          <Route path="/" component={WelcomePage}></Route>
        </Switch>
      </div>
    );
  }
}

export default App;
